(2712, 'zhCN', '茏葱织纹', '尼穆威纺织着翡翠梦境的迷人图案。我们的入侵扰乱了这个进程，所以被视作威胁。', 65727),
(2711, 'zhCN', '熔火侵攻', '拉罗达尔已经被烈焰扭曲，他企图让翡翠梦境化为火海。如果他得以成功，一切都将灰飞烟灭。', 65727),
