(2709, 'zhCN', '虚空之缘', '萨卡雷斯孑立在深渊边缘，企图驾驭奈萨里奥的力量，以及夺得这位前任大地守护者的遗产。', 65727),
(2708, 'zhCN', '奈萨里奥之影', '黑暗中，曾经腐化过大地守护者的那股力量开始再度苏醒，企图戕害更多生灵。', 65727),
(2707, 'zhCN', '巨人之怒', '扎卡利战团对熔炉发起了毁灭性的突袭，想要干掉任何阻挡他们的人。', 65727),
(2706, 'zhCN', '风暴之怒', '狂怒的莱萨杰丝图谋摧毁她同胞的牢狱。如成功，化身巨龙会为艾泽拉斯带来浩劫。', 65727),
(2705, 'zhCN', '注能岩洞', '库洛格·恐怖图腾准备释放可怕的元素，毁灭所有胆敢反对他的敌人。', 65727),
