(2348, 'zhCN', '宏伟蓝图', '典狱长即将获得最终的胜利。如果不阻止他，宇宙就将屈服于他的力量。', 65727),
(2347, 'zhCN', '统御之握', '佐瓦尔最强大的追随者们已经摧毁了浩如烟海的文明。这次他们会令整个宇宙寂灭吗？', 65727),
(2346, 'zhCN', '幻磷平原', '创生精华正在被吞噬，如果不力挽狂澜，现实就会坍缩。', 65727),
(2345, 'zhCN', '创生基石', '利许威姆在对抗统御之力时节节败退。如果不拯救利许威姆，这名守护者的力量就会属于典狱长。', 65727),
(2344, 'zhCN', '典狱长的报复', '希尔瓦娜斯在塔楼之巅等待着。在这里，决定宇宙命运的最终对峙即将开始。', 65727),
(2343, 'zhCN', '命运镣铐', '灵魂之河终结于塔楼顶层。摧毁那些吸取河流力量的人，解救无数被剥夺了死后命运的灵魂。', 65727),
(2342, 'zhCN', '晦暗刑狱', '饱受折磨的尖叫滋养着典狱长的大军。结束他们的折磨，剥夺噬渊最宝贵的资源。', 65727),
(2341, 'zhCN', '典狱长先锋军', '典狱长的先锋时刻准备着击退任何攻击。必须击溃他们的战线才能突入典狱长的圣所。', 65727),
(2340, 'zhCN', '谒见傲慢', '德纳修斯在他的高塔中急切地等待着英雄们的到来，这场对决会决定雷文德斯的命运。', 65727),
(2339, 'zhCN', '石中殷红', '德纳修斯的顽石军团干将正在等待，他们已经布下了圈套，足以一劳永逸地消灭起义军。', 65727),
(2338, 'zhCN', '丰饶圣物所', '贵族们陶醉在胜利中，而英雄们必须破坏他们的聚会，推翻他们的权位。', 65727),
(2337, 'zhCN', '汲心宝库', '心能从纳斯利亚堡的宝库中不断流出，就像伤口一般。如果不终止的话，雷文德斯会被彻底吸干。', 65727),
