INSERT INTO `mount_locale` (`ID`, `locale`, `Name_lang`, `SourceText_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2743, 'zhCN', '金辉破霄', '|cFFFFD200游戏商城|r', '雷霆镀金，天命所归。金色电光缠绕四蹄，破开苍穹如撕裂黑夜。传说它和皇帝少昊有着千丝万缕的关系。', 65727),
(2742, 'zhCN', '苍雷踏云', '|cFFFFD200游戏商城|r', '雷电之王陨灭后，其雷霆残魂融入白龙之魄。它踏苍雷而行，云随雷动，旧日暴政已化今日守护之光。', 65727),
(2798, 'zhCN', '青铜墓翼蝠', '|cFFFFD200成就：|r紊乱时间流之主 IV|n|cFFFFD200分类：|r时空漫游|n', '雷文德斯的居民通常更青睐黑暗与不祥的美学设计，但有些人还是喜欢闪亮的光泽。', 65727),
(2797, 'zhCN', '青铜冥蝇', '|cFFFFD200成就：|r紊乱时间流之主 IV|n|cFFFFD200分类：|r时空漫游', '装饰冥蝇的过程费时费力，但有些人认为这都是值得的。', 65727),
(2796, 'zhCN', '青铜北风长', '|cFFFFD200成就：|r紊乱时间流之主 IV|n|cFFFFD200分类：|r时空漫游|n|n', '晋升堡垒的可靠坐骑能够反映出晋升者战士们的自豪与崇高。', 65727),
(2795, 'zhCN', '青铜荒蚺', '|cFFFFD200成就：|r紊乱时间流之主 IV|n|cFFFFD200分类：|r时空漫游|n|n', '这只华贵的荒蚺在空中闪转腾挪，与它们飞行所用的不羁魔法一样自由。', 65727),
(1729, 'zhCN', '城里的大滑', '|cFFFFD200任务：|r蜗到成功|n|cFFFFD200地区：|r查拉雷克洞窟', '大滑有颗宽广的心，心里承载着伟大的梦想。', 65727);
